rulesetGrouping.rbnfRules:
%with-words:
0: 0 seconds; 1 second; =0= seconds;
60/60: <%%min<[, >>];
3600/60: <%%hr<[, >>>];
%%min:
0: 0 minutes; 1 minute; =0= minutes;
%%hr:
0: 0 hours; 1 hour; =0= hours;
%in-numerals:
0: =0= sec.;
60: =%%min-sec=;
3600: =%%hr-min-sec=;
%%min-sec:
0: :=00=;
60/60: <0<>>;
%%hr-min-sec:
0: :=00=;
60/60: <00<>>;
3600/60: <#,##0<:>>>;
%duration:
0: =%in-numerals=;
%%lenient-parse:
& ':' = '.' = ' ' = '-';
